    [],nt"revision_timestamp": "2013-11-27T19:25:20.645291",nt"name": "bureau-of-land-management-land-grant-boundaries",nt"isopen":
    false,nt"url": null,nt"notes": " This data has been collected by the U.S.
    Bureau of Land Management (BLM) in New Mexico atnthe New Mexico State Office. The
    initial data source is the statewide Public Land Survey Systemn(PLSS) coverage for
    the state of New Mexico, generated at the BLM New Mexico State Office.nAdditional
    data was onscreen-digitized from BLM Cadastral Survey Plats and Master Title Plats,
    orntablet-digitized from 1:24,000 paper maps. This revision reflects boundary adjustments
    made in thenAlbuquerque area to more accurately reflect boundaries as depicted on
    USGS 1:24,000 topographicnmaps. Note for Shapefiles: Shapefiles have been created
    from coverages using the "Export Coverage tonShapefile" function in ArcGIS 8.3.
    All occurrences of "#" and "-" in INFO item names are replacednwith an underscore
    character. This includes COVER# and COVER-ID, which become "COVER_" andn"COVER_ID".
    Additionally, the Shapefile format only allows 10 characters in item names, so long
